summary.label:
Mais que um aplicativo, é um aplicativo de delivery que permite aos seus clientes visualizarem o cardápio ofertado pelo estabelecimento e fazerem pedidos pelo smartphone, sendo uma ferramenta ideal para aumentar seus ganhos e prática facilitando que o pedido possa ser entregue onde o cliente se encontrar no momento do pedido.

Funcionalidades:
- cadastro rápido ou cadastro pelo Facebook;
- cardápio ilustrativo, com preços dos produtos;
- pedidos sem taxas para o cliente;
- taxa de entrega é cobrada pelo restaurante;
- pagamento na maquininha.
